import { Component } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { NgModule } from '@angular/core';


@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  options = [
    { label: 'Option 1', checked: false },
    { label: 'Option 2', checked: false },
    { label: 'Option 3', checked: false },
    { label: 'Option 4', checked: false }
  ];
  selectedOptions: string[] = [];
  filteredOptions: { label: string, checked: boolean }[] = [];
  searchValue: string = '';

  ngOnInit() {
    this.filteredOptions = this.options;
  }

  toggleOption(option: any) {
    if (option.checked) {
      this.selectedOptions.push(option.label);
    } else {
      const index = this.selectedOptions.indexOf(option.label);
      if (index > -1) {
        this.selectedOptions.splice(index, 1);
      }
    }
  }

  removeOption(option: string) {
    const index = this.selectedOptions.indexOf(option);
    if (index > -1) {
      this.selectedOptions.splice(index, 1);
    }
  }

  filterOptions() {
    this.filteredOptions = this.options.filter(option =>
      option.label.toLowerCase().includes(this.searchValue.toLowerCase())
    );
  }

  submit() {
    console.log(this.selectedOptions);
    // You can perform further actions with the selectedOptions array
  }
}
<div>
  <label>Selected Options</label>
  <div class="chip-container">
    <div class="chip" *ngFor="let option of selectedOptions">
      {{ option }}
      <span class="close-icon" (click)="removeOption(option)">&times;</span>
    </div>
  </div>
</div>
<div style="border: 1px solid black">
  <div>
    <label>Options</label>
    <input type="text" [(ngModel)]="searchValue" (input)="filterOptions()" placeholder="Search">
    <div *ngFor="let option of filteredOptions">
      <input type="checkbox" [(ngModel)]="option.checked" (change)="toggleOption(option)">
      <span>{{ option.label }}</span>
    </div>
  </div>
  <button (click)="submit()">Submit</button>
</div>
